svg.script:
var planets = []
var gm = 1
var maxr = 1
var zoom = 1

function load()
{
	var index = 0
	var dot = document.getElementById("dot"+index)
	for (; dot; dot = document.getElementById("dot" + (++index)))
	{
		var x = parseFloat(dot.getAttribute("planet_x"))
		var y = parseFloat(dot.getAttribute("planet_y"))
		var z = parseFloat(dot.getAttribute("planet_z"))

		planets.push({x: x, y: y, z: z, newx: x, newy: y, newz: z, 
		speed_x: parseFloat(dot.getAttribute("speed_x")),
		speed_y: parseFloat(dot.getAttribute("speed_y")),
		speed_z: parseFloat(dot.getAttribute("speed_z")),
		dot: dot,
		ring: document.getElementById("ring" + index)})
	}


	if (planets.length == 0)
		for (i = 0; i < 100; i++)
		{
			var x = Math.random() 
			var y = Math.random() 
			var z = Math.random() 
			planets.push({x: x, y: y, z: z, newx: x, newy: y, newz: z, speed_x: 0, speed_y: 0, speed_z: 0})
		}
	else
	{
		var dots = document.getElementById("dots")
		maxr = parseFloat(dots.getAttribute("maxr"))
		zoom = parseFloat(dots.getAttribute("zoom"))
		gm = parseFloat(dots.getAttribute("gm"))

	}
}
load()


function calc_new_xy(planet, force){
	var dx = force.x - planet.x
	var dy = force.y - planet.y
	var dz = force.z - planet.z
	var dl2 = dx * dx + dy * dy + dz * dz

	var gravity = gm / dl2

	planet.newx += gravity * dx 
	planet.newy += gravity * dy 
	planet.newz += gravity * dz 

}

function set_xy(planet)
{
	planet.newx += planet.speed_x
	planet.newy += planet.speed_y
	planet.newz += planet.speed_z
	planet.speed_x = planet.newx - planet.x
	planet.speed_y = planet.newy - planet.y
	planet.speed_z = planet.newz - planet.z
	planet.x = planet.newx
	planet.y = planet.newy
	planet.z = planet.newz
}

var mps = 0

function move(){
	for (r=0; r < maxr; r++)
	{
		mps++
		var p1 = planets[0]
		var next
		var length = planets.length
		for (i = 0; i < length; i++)
		{
			for (o = i+1; o < length; o++)
			{

				var p2 = planets[o]
				if (o == i+1)
					next = p2
				calc_new_xy(p1, p2)
				calc_new_xy(p2, p1)
			}
			set_xy(p1)
			p1 = next
		}
	}
	if (!pause) { pause=true; window.requestAnimationFrame(draw); }
}

var fps = 0

var dots = document.getElementById("dots")
var dots_parent = dots.parentNode
var rings = document.getElementById("rings")
var rings_parent = rings.parentNode
function draw(){
	fps++
	dots_parent.removeChild(dots);
	rings_parent.removeChild(rings);
	for (i = 0; i < planets.length; i++)
	{
		var planet = planets[i]			
		var dot = planet.dot, ring = planet.ring;
		if ( !dot )
		{
			dot = document.createElementNS("http://www.w3.org/2000/svg","circle")
			ring = document.createElementNS("http://www.w3.org/2000/svg","circle")
			planet.dot = dot; planet.ring = ring;

			dot.setAttribute("id", "dot"+i)
			ring.setAttribute("id", "ring"+i)

			dot.setAttribute("r", "0.5%")
			var color = Math.floor(Math.random() * 0xFFFFFF).toString(16)
			for (;color.length < 6;)
				color = "0" + color;

			dot.setAttribute("fill", "#" + color )

			dots.appendChild(dot)
			rings.appendChild(ring)


		}

		var x = planet.x, y = planet.y, z = planet.z;

		dot.setAttribute("planet_x", x)
		dot.setAttribute("planet_y", y)
		dot.setAttribute("planet_z", z)
		dot.setAttribute("speed_x", planet.speed_x)
		dot.setAttribute("speed_y", planet.speed_y)
		dot.setAttribute("speed_z", planet.speed_z)


		x = 50 + x * zoom
		y = 50 + y * zoom
		z = z * zoom / 10

		dot.setAttribute("cx", x + "%")
		dot.setAttribute("cy", y + "%")

		if (z > 0)
		{
			ring.setAttribute("r", z + "%");
			if (z < 0.5)
				dot.setAttribute("r", z + "%");

		}
		ring.setAttribute("cx", x + "%")
		ring.setAttribute("cy", y + "%")
	}
	dots.setAttribute("maxr", gm)
	dots.setAttribute("gm", gm)
	dots.setAttribute("zoom", zoom)
	rings_parent.appendChild(rings);
	dots_parent.appendChild(dots);
	pause = false;
}

setInterval(move, 0)

setInterval(function(){console.log(mps, fps); mps=0; fps=0}, 1000)
var draw_interval

var pause = false;
function start(){
	pause=false;
}

function stop(){
	pause=true;
}
start()

/** This is high-level function.
 * It must react to delta being more/less than zero.
 */
function handle(delta) {
		if (delta < 0)
			zoom=zoom*2;
		else
			zoom=zoom/2;
}

/** Event handler for mouse wheel event.
 */
function wheel(event){
		var delta = 0;
		if (!event) /* For IE. */
				event = window.event;
		if (event.wheelDelta) { /* IE/Opera. */
				delta = event.wheelDelta/120;
		} else if (event.detail) { /** Mozilla case. */
				/** In Mozilla, sign of delta is different than in IE.
				 * Also, delta is multiple of 3.
				 */
				delta = -event.detail/3;
		}
		/** If delta is nonzero, handle it.
		 * Basically, delta is now positive if wheel was scrolled up,
		 * and negative, if wheel was scrolled down.
		 */
		if (delta)
				handle(delta);
		/** Prevent default actions caused by mouse wheel.
		 * That might be ugly, but we handle scrolls somehow
		 * anyway, so don't bother here..
		 */
		if (event.preventDefault)
				event.preventDefault();
	event.returnValue = false;
}

/** Initialization code. 
 * If you use your own event management code, change it as required.
 */
if (window.addEventListener)
		/** DOMMouseScroll is for mozilla. */
		window.addEventListener('DOMMouseScroll', wheel, false);
/** IE/Opera. */
window.onmousewheel = document.onmousewheel = wheel;
